message:
jbd2: fix duplicate debug label for phase 2

Currently we see this output:

  $git grep phase fs/jbd2
  fs/jbd2/commit.c:       jbd_debug(3, "JBD2: commit phase 1\n");
  fs/jbd2/commit.c:       jbd_debug(3, "JBD2: commit phase 2\n");
  fs/jbd2/commit.c:       jbd_debug(3, "JBD2: commit phase 2\n");
  fs/jbd2/commit.c:       jbd_debug(3, "JBD2: commit phase 3\n");
  fs/jbd2/commit.c:       jbd_debug(3, "JBD2: commit phase 4\n");
  [...]

There is clearly a duplicate label for phase 2, and they are
both active (i.e. not in #if ... #else block).  Rename them to
be "2a" and "2b" so the debug output is unambiguous.

Signed-off-by: Paul Gortmaker <ae947f3c8df96e1dc851c5e3e5a930ce6d3f1f74@windriver.com>
Signed-off-by: "Theodore Ts'o" <4ed386e0495d3e109932df055831d9ec2f824927@mit.edu>

Fix for XMLRPC issue.  We no longer depend on an XML parse.  It was unsuccessful sometimes.  Instead the code does a quick regex parse of the returned web page text.

This commit also includes a modalViewController "pop-up" for cases where we can't hit the xmlrpc endpoint.  The view gives the user the opportunity to manually enter their xmlrpc endpoint url.

This was a bit tricky to test - I left one line of code (commented out) in BlogDataManager:refreshCurrentBlog that serves as a test by setting the xmlrpc value to nil so that the view that requests the manual entry will get shown.  Future testers will want to look for this line... at the time of this writing, line number 1110 in BlogDataManager

	//Unique search string: ^^XMLRPC Endpoint
	//xmlrpc = nil;

Rule: no-empty-class

The `no-empty-class` rule disallows the use of empty character classes in regular expression literals:

var foo = /^abc[]/;

It does not disallow empty character classes in the `RegExp` constructor:

var foo = new RegExp("^abc[]");

This rule matches the JSLint rule: http://jslinterrors.com/empty-class/

Abstraction des clauses avec WHERE dans les UPDATE sur un seul champ

Dépot obtenu par:

{{{
for i in $(grep -l 'spip_query..UPDATE.*SET[^,]*WHERE.*; *$' [a-i]*/*php|grep -v inc/meta.php)
do
echo $i
sed 's/spip_query."UPDATE *\([^ ]*\) *SET *\([^ ,=]*\) *= *\([^,"$W+,)]*[^$, ]\) *WHERE *\(.*;\)/sql_updateq("\1", array("\2" => \3), "\4/;s/ => [^$a-z]\(\$[a-z0-9_]*\)[^a-z_]/ => \1/' $i > x
mv x $i
done
}}}

