Use SimpleArrayMap in implementation, hide constructor

This allows shrinkers to remove ArrayMap and associated types which are required to support the full Map interface.

Since VersionedParcel is a sealed hierarchy, hide the supertype constructor and fields for the maps. I have confirmed that these are not referenced outside of the library.

    $ grep -r 'androidx/versionedparcelable/VersionedParcel.<init>' .
    ./androidx.versionedparcelable/versionedparcelable/1.0.0-rc01/classes/androidx/versionedparcelable/VersionedParcelStream.bytecode:93:    INVOKESPECIAL androidx/versionedparcelable/VersionedParcel.<init> ()V
    ./androidx.versionedparcelable/versionedparcelable/1.0.0-rc01/classes/androidx/versionedparcelable/VersionedParcelParcel.bytecode:64:    INVOKESPECIAL androidx/versionedparcelable/VersionedParcel.<init> ()V
    ./androidx.versionedparcelable/versionedparcelable/1.1.0-alpha02/classes/androidx/versionedparcelable/VersionedParcelStream.bytecode:129:    INVOKESPECIAL androidx/versionedparcelable/VersionedParcel.<init> (Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;)V
    ./androidx.versionedparcelable/versionedparcelable/1.1.0-alpha02/classes/androidx/versionedparcelable/VersionedParcelParcel.bytecode:83:    INVOKESPECIAL androidx/versionedparcelable/VersionedParcel.<init> (Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;)V
    ./androidx.versionedparcelable/versionedparcelable/1.1.0-beta01/classes/androidx/versionedparcelable/VersionedParcelStream.bytecode:129:    INVOKESPECIAL androidx/versionedparcelable/VersionedParcel.<init> (Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;)V
    ./androidx.versionedparcelable/versionedparcelable/1.1.0-beta01/classes/androidx/versionedparcelable/VersionedParcelParcel.bytecode:83:    INVOKESPECIAL androidx/versionedparcelable/VersionedParcel.<init> (Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;Landroidx/collection/ArrayMap;)V
    ./androidx.versionedparcelable/versionedparcelable/1.0.0-beta01/classes/androidx/versionedparcelable/VersionedParcelStream.bytecode:93:    INVOKESPECIAL androidx/versionedparcelable/VersionedParcel.<init> ()V
