Fix Regex error in NodeTaskExecutor #192

Attempt to find user name and password in proxy argument string and mask it.
Passses following likely and some very unlikly scenarios:
public static class Testing {
    public static void main(String[] args) {
        assert NodeTaskExecutor.maskPassword(null) == null;
        assert "".equals(NodeTaskExecutor.maskPassword(""));
        assert " ".equals(NodeTaskExecutor.maskPassword(" "));
        assert "proxy=//abc:def@example.com:8080".equals(NodeTaskExecutor.maskPassword("proxy=//abc:def@example.com:8080"));
        assert "proxy=http://abc:***@1.2.3.4:8080".equals(NodeTaskExecutor.maskPassword("proxy=http://abc:def@1.2.3.4:8080"));
        assert "proxy=http://abc:***@example.com:8080".equals(NodeTaskExecutor.maskPassword("proxy=http://abc:de:f@example.com:8080"));
        assert "proxy=http:////:***@example.com:8080".equals(NodeTaskExecutor.maskPassword("proxy=http:////:::@example.com:8080"));
        assert "proxy=http://///@/:***@example.com:8080".equals(NodeTaskExecutor.maskPassword("proxy=http://///@/::://:@:@example.com:8080"));
        assert "proxy=http:// ///@/:***@example.com:8080".equals(NodeTaskExecutor.maskPassword("proxy=http:// ///@/::://:@ :@example.com:8080"));
        assert "proxy=https:// ///@/:***@example.com:8080".equals(NodeTaskExecutor.maskPassword("proxy=https:// ///@/::://:@ :@example.com:8080"));
    }
}

Refactor String#replaceAll (#1146)

If we repeatedly call String#replaceAll, we internally repeatedly call the regular expression pattern compilation every time as following:

```java
    public String replaceAll(String regex, String replacement) {
        return Pattern.compile(regex).matcher(this).replaceAll(replacement);
    }
```
The modifications are to keep the compiled pattern.
Therefore, compiling a relatively expensive regular expression pattern does not have to be done every time.

